                        <h1 class="word">catalyst <span class="pronunciation">[ kat-l-ist ]</span></h1>
                        <h2 class="section-title">noun</h2>

                        <div class="definition">
                            <strong>1. Chemistry:</strong> a substance that causes or accelerates a chemical reaction without itself being affected.
                        </div>

                        <div class="definition">
                            <strong>2.</strong> something that causes activity between two or more persons or forces without itself being affected.
                        </div>

                        <div class="definition">
                            <strong>3.</strong> a person or thing that precipitates an event or change:
                            <div class="example">His imprisonment by the government served as the catalyst that helped transform social unrest into revolution.</div>
                        </div>

                        <div class="definition">
                            <strong>4.</strong> a person whose talk, enthusiasm, or energy causes others to be more friendly, enthusiastic, or energetic.
                        </div>
